package com.inmobi.sdk.test.helper;

public class TestCaseData {
	
	private String id;
	private String sdk;
	private String androidOS;
	private String adType;
	private String cta;
	private String cta_url;
	private String adUrl;
	

	
	public TestCaseData() {
		// TODO Auto-generated constructor stub
	}



	public String getSdk() {
		return sdk;
	}



	public void setSdk(String sdk) {
		this.sdk = sdk;
	}



	public String getAndroidOS() {
		return androidOS;
	}



	public void setAndroidOS(String androidOS) {
		this.androidOS = androidOS;
	}



	public String getAdType() {
		return adType;
	}



	public void setAdType(String adType) {
		this.adType = adType;
	}



	public String getCta() {
		return cta;
	}



	public void setCta(String cta) {
		this.cta = cta;
	}



	public String getCta_url() {
		return cta_url;
	}



	public void setCta_url(String cta_url) {
		this.cta_url = cta_url;
	}



	public String getId() {
		return id;
	}



	public void setId(String id) {
		this.id = id;
	}



	public String getAdUrl() {
		return adUrl;
	}



	public void setAdUrl(String adUrl) {
		this.adUrl = adUrl;
	}



}
